message: >-
  There are  a lot different types of darknet marketplaces, some are specialized
  for particular types of products, such as counterfeit currency, or stolen
  credit card information in Sweden. The most famous example of a darknet market
  directory is <a href="https://darkcatalog.com/">darkcatalog</a>.
